import pxProperties from './px';
import degProperties from './deg';
import transformProperties from './transform';
import roundFloat from '../utils/roundFloat';
import createInterpolable from '../Interpolable/createInterpolable';
import addUnits from '../Interpolable/addUnits';

export const unitForProperty = function(key, value) {
	if (typeof value !== 'number') return '';
	if (pxProperties.has(key)) return 'px';
	if (degProperties.has(key)) return 'deg';
	return '';
};

export const transformValueForProperty = function(key, value) {
	const match = `${value}`.match(/^([0-9.-]*)([^0-9]*)$/);

	let val;
	let unit;
	if (match) {
		val = match[1];
		unit = match[2];
	} else {
		val = parseFloat(value);
	}
	val = roundFloat(parseFloat(val), 10);
	if (unit === undefined || unit === '') {
		unit = unitForProperty(key, value);
	}
	return `${key}(${val}${unit})`;
};

export const parseProperties = function(properties) {
	const parsed = {};
	for (const property in properties) {
		const value = properties[property];
		if (!transformProperties.has(property)) {
			parsed[property] = value;
			continue;
		}

		const match = property.match(/(translate|rotate|skew|scale|perspective)(X|Y|Z|)/);
		if (match && match[2].length > 0) {
			parsed[property] = value;
			continue;
		}

		['X', 'Y', 'Z'].forEach(axis => (parsed[match[1] + axis] = value));
	}
	return parsed;
};

export const getCurrentProperties = function(obj) {
	const keys = Object.keys(obj);
	const properties = keys.reduce((properties, key) => {
		properties[key] = createInterpolable(obj[key]);
		return properties;
	}, {});
	addUnits(obj, properties);
	return properties;
};

export const applyProperties = function(from, to) {
	const properties = parseProperties(to);
	const transforms = [];
	for (const key in properties) {
		const value = properties[key];
		if (transformProperties.has(key)) {
			transforms.push([key, value]);
		} else {
			let val = value.format ? value.format() : value;
			if (typeof val === 'number') {
				val = `${val}${unitForProperty(key, val)}`;
			}
			if (key in from) {
				from[key] = val;
			}
		}
	}

	from.transform = transforms
		.map(([key, value]) => transformValueForProperty(key, value.format ? value.format() : value))
		.join(' ');
};
